import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // 1. Click on the first product card to open the detail view
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.locator('.product-card').first().click();

    // 2. Wait for the product detail modal to appear
    await page.waitForSelector('#productModal', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal.png'));

    // 3. Click the "Add to Wish List" button
    await page.waitForSelector('button.add-to-wishlist', { timeout: 5000 });
    await page.locator('button.add-to-wishlist').click();

    // 4. Wait for the success notification
    await page.waitForSelector('.notification.success:has-text("Added to wishlist!")', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_wishlist_notification.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_wishlist_notification.png'));

    // 5. Navigate to the Wish List page by clicking the link
    await page.waitForSelector('a:has-text("Your Wish List")', { timeout: 5000 });
    // Use getByRole for better accessibility and robustness
    await page.getByRole('link', { name: 'Your Wish List' }).first().click();

    // 6. Wait for the wishlist page content to load
    await page.waitForSelector('.wishlist-page', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_wishlist_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_wishlist_page.png'));

    // 7. Extract data to verify the product was added
    await page.waitForSelector('.wishlist-item', { timeout: 5000 });
    const wishlistItemTitle = await page.locator('.wishlist-item .wishlist-title').textContent();
    const wishlistItemPrice = await page.locator('.wishlist-item .wishlist-price').textContent();

    return {
      success: true,
      action: "Successfully added a product to the wishlist and verified its presence.",
      extractedData: {
        productTitle: wishlistItemTitle,
        productPrice: wishlistItemPrice,
        itemCount: await page.locator('.wishlist-item').count()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // On failure, capture a final screenshot if possible
    try {
      const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
      await page.screenshot({ path: errorScreenshotPath });
      screenshots.push(errorScreenshotPath);
    } catch (e) {
      // Ignore if screenshot fails
    }

    return {
      success: false,
      action: "Failed to add product to wishlist",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
